import Avatar from 'portfolio/src/assets/DSC_5388.JPG';

const Body = () => {
  return(
    <div id="body" className="body">
      <div className="body-container">
        <div className="body-profile">
          <img className="body-img" alt='avatar' src={Avatar} />

          <div className="body-content">
            <div className="body-headline">Joshua Muriithi</div>
            <div classname="body-text">CyberSecurity Architect</div>
          </div>
          <div className="body-icons">
            <a href="https://www.linkedin.com/in/joshua-
muriithi" target="_blank" rel="nonreferrer" className="icon-link"><i><FaGithub /></i></a>
            <a href="https://www.linkedin.com/in/joshua-
muriithi" target="_blank" rel="nonreferrer" className="icon-link"><i><FaLinkedIn /></i></a>
          </div>
        </div>
      </div>
    </div>
  )
}
export default Body;
